import React from 'react';
import { Col, Container, Row, } from 'react-bootstrap';
import logo from './logo.png'

export default function Header () {
    return (
        <Container className='header'>
            <Row>
                <Col>
                    <a href="">notify</a>
                </Col>

                <Col>
                    <img src={logo}></img>
                </Col>

                <Col>
                    <a href="">Ingresar</a>
                </Col>
            </Row>
        </Container>
    )
}
